import React from "react";
import "./skills.css";
import work from "../download/work.jpg";

class Skills extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        }
    }
    render() {
        return (
            <React.Fragment>
                <div className="work_content">
                    <div className="skills_wapper">
                        <div className="skills_container">
                            <span>html</span>
                            <div className="load_slider"></div>
                        </div>
                        <div className="skills_container">
                            <span>css</span>
                            <div className="load_slider"></div>
                        </div>
                        <div className="skills_container">
                            <span>javascrit</span>
                            <div className="load_slider"></div>
                        </div>
                        <div className="skills_container">
                            <span>reactjs</span>
                            <div className="load_slider"></div>
                        </div>
                        <div className="skills_container">
                            <span>c</span>
                            <div className="load_slider"></div>
                        </div>
                        <div className="skills_container">
                            <span>c++</span>
                            <div className="load_slider"></div>
                        </div>
                    </div>
                    <div>
                        <img src={work} alt="work" />
                    </div>
                </div>


            </React.Fragment>
        )
    }
}

export default Skills;
